import React from 'react';
import '../App.css';
import HeroSection from '../components/Hero/HeroSection';
import { Card } from "../components";
import {
  homeOjbFive,
  homeOjbFour,
  homeOjbOne,
  homeOjbSix,
  homeOjbThree,
  homeOjbTwo,
} from "./Data";


function Home() {
  return (
    <>
      <HeroSection />
      <Card {...homeOjbOne} />
      <Card {...homeOjbTwo} />
      <Card {...homeOjbThree} />
      <Card {...homeOjbFour} />
      <Card {...homeOjbFive} />
      <Card {...homeOjbSix} />

    </>
  );
}

export default Home;
